import React from "react";
import ReactDOM from "react-dom/client";
import App from "./App.jsx";


root.render(
    <ReduxProvider store={store}>
      <ConfigProvider>
        <BrowserRouter basename={process.env.REACT_APP_BASE_NAME}>
          <App />
        </BrowserRouter>
      </ConfigProvider>
    </ReduxProvider>
  );
